    "Dataset of all Indian Reservations in US EPA Region 9 (California, Arizona and
    Nevada) with some reservation border areas of adjacent states included (adjacent
    areas of Colorado, New Mexico and Utah). Reservation boundaries are compiled from
    multiple sources and are derived from several different source scales. Information
    such as reservation type, primary tribe name are included with the feature dataset.
    Public Domain Allotments are not included in this data set.",nt"license_title":
