    "["Use Constraints: Approximately 60% of the reservation boundaries have a source
    scale of 1:100,000. The remaining have a source scale of1:24,000. The existence
    of each reservation has been confirmed by current sources (March 2000), but some
    boundary changes during the last 50 years may not be accounted for. Source for the
    December 2006 updates are the: Navajo Nation; Hopi Nation; Zuni Nation; EPA Region
    6 (New Mexico not already refered to). Source for the Aug 2004 updates is the 2002
    Field Directory of the California Indian Community. Guidiville Rancheria and the
    Pine Nut Allotments are missing from this coverage. The boundary data was unavailable
    at the time of completion. Colorado River tribal boundary was updated after consultation
    with the Arizona BIA. The editing was performed in ArcMap using a 24k USGS topo
    map for reference. The resulting boundary was sent to the Colorado River tribe for
    review. Very small reservation boundaries are not readily visible when mapping at
    regional, statewide or large scale levels. 2002 Field Directory of the California
    Indian Community, California Indain Assistance Program. Department of Housing and
    Community Development, State of California was used as the source for the following
    tribes - Paskenta Band of Nomlaki Indians, Graton Rancheria, Lytton Rancheria, Auburn
    Rancheria. Res_code field is not populated for these tribes.", "Access Constraints:
